const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Archer</li><li>True Name: Euryale</li><li>Gender: Female</li><li>Source: Greek mythology</li><li>Region: Europe</li><li>Alignment: Chaotic Good</li><li>Height: 134 cm</li><li>Weight: 30 kg (reported by Medusa)</li></ul><p><strong>Meta</strong></p><ul><li>Setting creation: Hikaru Sakurai, Nasu Kinoko</li><li>Original character design: Takeuchi Takashi</li><li>Character design: AKIRA</li><li>CV: Asakawa Yuu</li><li>Main works appearance: Fate/Hollow Ataraxia</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">EX</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">EX</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">C</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [A]</strong></p><p>Invalidate A rank magic and below.</p><p>Magic used by magus of modern era would not be able to injure her.</p><p><strong>Independent Action: [A+]</strong></p><p>Euryale possesses the Independent Action Skill at high rank.</p><p>A goddess is freedom in and of itself.</p><p><strong>Goddess&#39; Divine Core: [EX]</strong></p><p>A Skill representing one&#39;s status as a goddess perfected since birth.</p><p>Has the effect of preserving the absoluteness of mind and body. Repels all sorts of mental interference, halts body growth, and change nothing of the body no matter how much calorie is consumed.</p><p>A composite Skill that also comprises the Divinity Skill.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Bloodsucking: [C]</strong></p><p>Restores magic energy by means of bloodsucking.</p><p>Restoration is possible with anyone&#39;s blood, but because she likes Medusa&#39;s blood the most, sucking Medusa&#39;s blood would greatly restore her magic energy.</p><p><strong>Alluring Melody: [A]</strong></p><p>The natural disposition of beautiful voice.</p><p>Against male, it works an effect similar to that of a fascination magic; evasion is possible with Magic Resistance Skill.</p><p>A degree of effect reduction is also possible even if the target does not possess Magic Resistance skill as long as the target has the will to resist it.</p><p><strong>Whim of the Goddess: [A]</strong></p><p>Her nature that manifested as a Skill due to her being a goddess.</p><p>It bestows various effects, but not necessarily limited to beneficial ones.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="eye-of-the-euryale-gaze-of-the-goddess" tabindex="-1"><a class="header-anchor" href="#eye-of-the-euryale-gaze-of-the-goddess" aria-hidden="true">#</a> Eye of the Euryale - Gaze of the Goddess</h1><ul><li>Rank: B</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 1~99</li><li>Maximum target: 1 person</li></ul><p>Eye of the Euryale.</p><p>The charm of the goddess, capable of turning heroes into captives by a single blow, taking form as a Noble Phantasm.</p><p>On her bow, her bewitching charm; on her arrowheads, her sweet, sweet whispers. An arrow that will shoot down the hearts of any male, be they a human or a god.</p><p>Its appearance is truly divine. Also cute. A golden bow patterned with heartmarks all over it.</p><p>Say, isn&#39;t that the God Cupid&#39;s... is what her younger sister was about to say before meeting a terrible fate.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First pronoun: watashi</li><li>Second pronoun: anata</li><li>Third pronoun: kare/kanojo</li></ul><ul><li>She calls Stheno &quot;watashi (Stheno)&quot; for both second and third pronoun</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>A beautiful maiden, purity and chastity themselves given form.</p><p>Her character is free and unrestrained, her action without concern, her smile overflowing, and her words and deeds pure.</p><p>The perfect goddess, the ideal woman.</p><p>A &quot;cute maiden&quot; who thoroughly behaves spoiledly and makes men cares about her. Beautiful and adorable things, she freely and unconditionally loves; while ugly things, she unconditionally hates.</p><p>At least, that&#39;s how she pretends to be-----</p><p>The truth is, although she is endowed with purity and chastity, at her core one can say that she is extremely sly and capricious. She thinks that as long as she keeps quiet about it no one will get mad, and that it&#39;s not a fraud if no one knows about it. (ALthough she would end up on a self-loathing afterwards.)</p><p>She possesses a sort of timidity, one that differs from her other self (Stheno).</p><p>She gives off a bit of a tsundere feeling.</p><p>Particularly, even though she bullies her younger sister Medusa together with Stheno whenever possible. In truth, she loves her. She truly loves her.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>She shows her smiling face towards the Master in a pleased manner.</p><p>But to tell the truth, this is due to her enjoying watching someone on the path to ruin. With the Master being the first human she had laid her eyes on ever since a while, she wants to observe his/her suffering to her fill. For her to force unreasonable demands is a matter of course.</p><p>Only those who manage to overcome this bargain sale of unreasonable demands are worthy of actual conversation with her.</p><p>She has no wish towards the Holy Grail.</p><p>If she is compelled to think of one, it would be to &quot;return to the place where the three sisters once were&quot;, but she already knows. That it is nothing but a wish that would never come true.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;I am Euryale. Mm, yes, I am indeed a goddess. Although yours would be a short life, do your best to make this most enjoyable for me, alright?&quot;</p><p>&quot;I don&#39;t care much about Medusa. ...Although, well, I suppose a servant is necessary.&quot;</p><p>&quot;Now now, hurry up and come out. I (Stheno) had just received such a lovely gift. Just for today, I shall share it with you. &quot;</p><p>&quot;I detests noisy people. To say nothing of violent ones. ....No. I just, hate people.&quot;</p><p>&quot;You are prepared to fall for me, of course?&quot;</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>She has no ability to fight, and she is unable to survive on her own.</p><p>The eternal maiden, unable to live without accepting help from others-----</p><p>The second daughter of the three Gorgon sisters from the Greek mythology.</p><p>The embodiment of men&#39;s yearning, she is a goddess born as the perfect idol.</p><p>The same with the eldest daughter Stheno, she was once one of the gods of ancient Greek. Normally there is no way for her to be summoned as a Servant, but for some reason she manifested anyway. She is truly weak, possessing practically no combat prowess, but her Noble phantasm is exceedingly powerful in a certain sense.</p><p>Helplessly weak in exchange for eternal beauty...such is a goddess she should have been, but due to becoming a Servant she becomes somewhat stronger.</p><p>The Gorgon sisters were originally the same existence, so naturally Euryale and Stheno are eternally identical existences as well, connected together. Existing in a similar way with a certain kind of collective system, they call each other &quot;me&quot;.</p><p>(The third daughter is an exception; she ended up growing and becoming different in height and build, her heart losing her connection with them.)</p><h2 id="concept" tabindex="-1"><a class="header-anchor" href="#concept" aria-hidden="true">#</a> Concept</h2><p>An ancient idol.</p><p>As a genuine idol, she demonstrates the problematic characteristic of &quot;combat ability being of no use whatsoever, yet filled to the brim with only beauty&quot;.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Stheno</strong></p><p>Her other self.</p><p>She calls her as she calls herself, &quot;me&quot;.</p><p><strong>Medusa</strong></p><p>Her beloved younger sister. She actually really loves her.</p><p>On the surface she calls her &quot;mere slave&quot; and &quot;Meduseless&quot;, always bullying her. Her younger sister definitely fears her. And yet...</p><p>When Medusa was exiled to the Shapeless Isle by the twelve Olympians, she went together with her, as if it was only obvious that she would do so. She had continued to harbor no fear towards her sister, even as Medusa was gradually changing into a grotesque monster, and met her for the last time.</p><p><strong>Asterios</strong></p><p>The boy who had turned monster.</p><p>He reminds her of Medusa, and for some reason she just can&#39;t abandon him.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>As I was thinking of making them to have same hair color but different clothing detail, I thought what if &quot;the two who I would&#39;ve normally spend time to mirror trace each other&quot; becoming slightly different little by little? So I had the elder big sister&#39;s clothing layer to face inward while hers to face outward. I wanted to use anemone and cyperus for her headdress&#39; flowers, but although I want to split the latter in ones and twos, it became too hard to prepare it, so I ended up with the simple motif instead. She gives off a refreshed feeling comparatively (in contrast with the elder big sister).</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>(the whole thing is this: \u30D8\u30C3\u30C9\u30C9\u30EC\u30B9\u306E\u306F\u306A\u306B\u4E8C\u8F2A\u8349\u3068\u4E09\u8F2A\u8349, \u5F8C\u8005\u3092\u4E8C\u3064\u3068\u4E00\u3064\u306B\u308F\u3051\u3066\u4F7F\u3044\u305F\u304B\u3063\u305F\u306E\u3067\u3059\u304C\u3046\u307E\u304F\u4ED5\u8FBC\u3080\u306E\u304C\u96E3\u3057\u304F\u5358\u7D14\u306A\u306F\u306A\u30E2\u30C1\u30FC\u30D5\u306B\u306A \u3063\u3066\u3044\u307E\u3059, \u6BD4\u8F03\u7684\u30B9\u30C3\u3068\u6C17\u6301\u3061\u3092\u51FA\u3057\u3066\u304F\u308C\u305D\u3046\u306A\u59C9\u69D8\u306E\u30A4\u30E1\u30FC\u30B8\u3067\u3059 and it was long and some parts I&#39;m not sure I get right so if somebody got a better rendering of it Im all ears.)</p></div><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-134.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-135.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-136.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-137.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-138.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-139.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-140.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-141.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-142.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-143.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 102);
